import React from 'react';
import {Container,Grid,Box,styled,Paper} from '@mui/material';
import Navbar from './Navbar';
const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

function Header(props) {
    return (
      
        <React.Fragment>
              <Navbar/>
      <Container maxWidth="sm"  sx={{ background: "#063970",marginTop:30 }}>
      <Box sx={{ flexGrow: 1 }}>
      <Grid container spacing={2}>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={4}>
          <Item>xs=4</Item>
        </Grid>
        <Grid item xs={8}>
          <Item>xs=8</Item>
        </Grid>
      </Grid>
    </Box>
        </Container>
        </React.Fragment>
    );
}

export default Header;
